import React, { useState } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import {
  showMenu,
  showOrder,
  selectShow
} from './features/cook/cookSlice';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";




export default function App() {
  return (
    <Router>
      <div>

        <Switch>
          <Route path="/KhachHang">
            <KhachHang />
          </Route>
          <Route path="/QuanLy">
            <QuanLy />
          </Route>
          <Route path="/DauBep">
            <DauBep />
          </Route>
          <Route path="/">
            <KhachHang />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function KhachHang() {
  return <h2>Khách Hàng</h2>;
}



function QuanLy() {
  return <h2>QuanLy</h2>;
}
